import { Component } from "react";

const TableHeader = () =>{
    return(
        <thead>
            <tr>
                <th>Name</th>
                <th>Job</th>
            </tr>
        </thead>
    )
}

const TableBody = (props) =>{
    const {charactorsData} = props

    charactorsData.map( (charector)=>{
        return (<tr><td>{charector.name}</td><td>{charector.job}</td></tr>)
    })
    return(
        <tbody>  
        </tbody>

    )
}

class Table extends Component{
    render(){
     const {charactorsData}  = this.props
        return(
            <table>
                <TableHeader/>
                <TableBody charactorsData = {charactorsData}/>  
            </table>
        )
    }
}
export default Table;
